import express from "express";
import morgan from "morgan";
import globalRouter from "./routers/globalRouter";
import videoRouter from "./routers/videoRouter";
import userRouter from "./routers/userRouter";

const PORT = 4000;

const app = express();
const logger = morgan("dev");
app.use(logger);


app.use("/", globalRouter); // '/'ÏúºÎ°ú ÏãúÏûëÌïòÎäî urlÏù¥ ÏûàÏúºÎ©¥ Í∏ÄÎ°úÎ≤åÎùºÏö∞ÌÑ∞Î°ú
app.use("/videos", videoRouter); // 'videos'Î°ú ÏãúÏûëÌïòÎäî urlÏù¥ ÏûàÏúºÎ©¥ videoRouterÎ°ú Ïù¥Îèô
app.use("/users", userRouter);




const handleListening = () =>
  console.log(`‚úÖ Server listenting on port http://localhost:${PORT} üöÄ`);

app.listen(PORT, handleListening);

