videoRouter.get("/:id(\\d+)", see); //(\\d+) : expressÍ∞Ä Ïà´ÏûêÎßå Î∞õÍ≤å
videoRouter.get("/:id(\\d+)/edit", edit);
videoRouter.get("/:id(\\d+)/delete", deleteVideo);


export default videoRouter;

